    AND tgt2.OBU_DISCOUNT_FEE_SUM_BEFORE = #{obuDiscountFeeSumBefore}


    AND tgt2.OBU_DISCOUNT_FEE_SUM_AFTER = #{obuDiscountFeeSumAfter}


    AND tgt2.OBU_MILEAGE_BEFORE = #{obuMileageBefore}


