    AND tgt2.GANTRY_HEX_OPPOTIME LIKE '%' || #{gantryHexOppotime} || '%'


    AND tgt2.OBU_PAY_FEE_SUM_AFTER_NO_FIT = #{obuPayFeeSumAfterNoFit}


    AND tgt2.OBU_FEE_SUM_AFTER_NO_FIT = #{obuFeeSumAfterNoFit}


    AND tgt2.OBU_MILEAGE_AFTER_NO_FIT = #{obuMileageAfterNoFit}


    AND tgt2.FEE_PROV_BEGIN_HEX_BEFORE LIKE '%' || #{feeProvBeginHexBefore} || '%'


    AND tgt2.GANTRY_FIT_RESULT = #{gantryFitResult}


    AND tgt2.GANTRY_FIT_VERSION LIKE '%' || #{gantryFitVersion} || '%'


    AND tgt2.GANTRY_FIT_HEXS LIKE '%' || #{gantryFitHexs} || '%'


    AND tgt2.GANTRY_FIT_TOLLS LIKE '%' || #{gantryFitTolls} || '%'


    AND tgt2.GANTRY_FIT_NPROV_PAYFEE = #{gantryFitNprovPayfee}


    AND tgt2.GANTRY_FIT_NPROV_DISCONTFEE = #{gantryFitNprovDiscontfee}


    AND tgt2.GANTRY_FIT_NPROV_REALFEE = #{gantryFitNprovRealfee}


    AND tgt2.GANTRY_FIT_NPROV_MILES = #{gantryFitNprovMiles}


