    AND tgt2.GANTRY_FIT_NPROV_PAY_FEE_SUM = #{gantryFitNprovPayFeeSum}


    AND tgt2.GANTRY_FIT_NPROV_REAL_FEE_SUM = #{gantryFitNprovRealFeeSum}


    AND tgt2.GANTRY_FIT_NPROV_MILE_SUM = #{gantryFitNprovMileSum}


