    AND tgt2.RELATED_TRADE_ID LIKE '%' || #{relatedTradeId} || '%'


    AND tgt2.ALL_RELATED_TRADE_ID LIKE '%' || #{allRelatedTradeId} || '%'

SELECT

FROM TBL_GANTRY_TRANSACTION_${year} tgt2 WHERE tgt2.TRADE_ID IN

    #{tradeId}
